import bgImg from "../assets/bg.jpeg";

import React from "react";

const Intro = () => {
  return (
    <div className="intro">
      <div className="mask">
        <img className="bgImg" src={bgImg} alt="bgImg" />
      </div>
    </div>
  );
};

export default Intro;
